import React, { Component } from 'react';

class EditCourseForm extends Component {
    render() {
        return (
            <div>
                <form>
                    <div className="row">
                        <div className="col">
                        <div className="form-group col">
                                        <label for="inputAddress2">Date of Birth</label>
                                        <input
                                            onChange={e => this.setDob(e.target.value)}
                                            value={date ? date.substr(0, 10) : null}
                                            type="date" className="form-control"
                                            //onfocus={e=> this.setDob(e.target.selected)}
                                            id="inputAddress2"
                                            name="dob"
                                            placeholder={date ? date.substr(0, 10) : ""} />

                                    </div>
                        </div>
                        <div className="col">
                            <input type="date" className="form-control" placeholder="Last name" />
                        </div>
                    </div>

                </form>
            </div>
        );
    }
}

export default EditCourseForm;
